import React from "react";
import { Link } from "react-router-dom";

const Navbar = () =>{
    return(<>
       <Link to='/' style={{color:red}}> About US </Link>
       <Link to="/contact" style={{color:blue}}> Contact US </Link>
    </>
)}

export default Navbar;
